  return (
    <Grid container>
      {Array.from(new Array(8)).map((_, i) => (
        <Grid key = {i} container item >
          {Array.from(new Array(8)).map((_, j) => (
            <Grid item xs={1} key={j} sx={{ bgcolor: (i+j)%2 ? "white" : "black", height: '50px', width: '50px', border: "1px solid black"}}>

            </Grid>
          ))}
        </Grid>
      ))}
    </Grid>
  );
}

